    const [inputField, setInputField] = useState([
        { Name: '', Latitude: '', Longitude: '', Address: ''},
    ])

  return(

    <Container>

        <h1>Add New Locations</h1>

        <fieldset>
            { inputField.map((inputField, index) => (
                <div key={index}>
                    <input type="text" />

                </div>
            ))}

        </fieldset>

    </Container>    

  );

}


export default Table;
